import React from 'react';
import {AppBar, Box, Toolbar} from '@mui/material';
import MovieIcon from '@mui/icons-material/MovieCreation';

const Header = () => {
  return (
    <AppBar>
        <Toolbar>
           <Box width={'20%'}>
               <MovieIcon/>
           </Box>
           <Box width={'50%'} margin={'auto'}>

           </Box>
        </Toolbar>
    </AppBar>
  )
}

export default Header
